import {fetch} from "../pages/fetch";
import Link from "next/link";
import  React from "react";
import Modal from "../portal/Modal";
import "../public/styles/a.css";
import Login from "./login/login";
import styled from "styled-components";
import { Grid, Cell } from "styled-css-grid";


const MyGrid = ({data}) => (
    <Grid columns={data.length} gap="2px"> 
    <Modal />

    {data.map(obj => {
      return Object.entries(obj).map(([key, val], i) => {
        return (
          <Cell className="whatEver" key={i}>
          {/* {key} : {val} */}
          </Cell>
        );
      });
    })}
  </Grid>
);

const Index = ({ data,log_in }) =><div> {JSON.stringify(log_in)} <MyGrid data={data}></MyGrid></div>;
Index.getInitialProps = async () =>
{
  const f = fetch();
  console.log("fffffffffffffffffffffffffffff",f);
  const log_in = await f.request(`https://localhost:3000/users`, "get");
  const data = await f.request(`https://localhost:3000/login?name=George&password=password2`, "get");
  return {
    log_in,
    data
  };
};
export default Index;
